import List from "./List";
import { FaMinusSquare, FaPlusSquare, FaTrash } from "react-icons/fa";

const NewList = ({ list, onToggle, toggleList }) => {
  // console.log(list);
  return (
    <ul type="none">
      {Object.keys(list).length
        ? Object.keys(list).map((key, i) => (
            <>
              <li key={key}>
                {Object.keys(list[key]).length ? (
                  toggleList === key ? (
                    <FaPlusSquare
                      style={{
                        fontSize: "0.75rem",
                        paddingRight: "0.25rem",
                        cursor: "pointer",
                      }}
                      onClick={onToggle(key)}
                    />
                  ) : (
                    <FaMinusSquare
                      style={{
                        fontSize: "0.75rem",
                        paddingRight: "0.25rem",
                        cursor: "pointer",
                      }}
                    />
                  )
                ) : null}
                {key}{" "}
                <FaTrash
                  style={{
                    cursor: "pointer",
                    float: "right",
                    marginRight: "40rem",
                    fontSize: "0.75rem",
                  }}
                />
              </li>
              <List
                list={list[key]}
                onToggle={onToggle}
                toggleList={toggleList}
              />
            </>
          ))
        : ""}
    </ul>
  );
};

export default NewList;
